import React from 'react';
import './App.module.css';
import Votes from "./data.json";
import { DataGrid } from '@mui/x-data-grid';

const columns = [
  { field: 'county_desc', headerName: 'county_desc', width: 100 },
  { field: 'first_name', headerName: 'first_name', width: 100 },
  { field: 'last_name', headerName: 'last_name', width: 100 },
  { field: 'voter_status_desc', headerName: 'voter_status_desc', width: 100 },
  { field: 'voter_status_reason_desc', headerName: 'voter_status_reason_desc', width: 100 },
  { field: 'res_street_address', headerName: 'res_street_address', width: 100 },
  { field: 'res_city_desc', headerName: 'res_city_desc', width: 100 },
  { field: 'state_cd', headerName: 'state_cd', width: 100 },
  { field: 'zip_code', headerName: 'zip_code', width: 100 },
  { field: 'mail_addr1', headerName: 'mail_addr1', width: 100 },
  { field: 'mail_city', headerName: 'mail_city', width: 100 },
  { field: 'mail_state', headerName: 'mail_state', width: 100 },
  { field: 'mail_zipcode', headerName: 'mail_zipcode', width: 100 },
  { field: '', headerName: '', width: 100 },
  { field: '', headerName: '', width: 100 },
  { field: '', headerName: '', width: 100 },
  { field: '', headerName: '', width: 100 },
  { field: '', headerName: '', width: 100 },
  { field: '', headerName: '', width: 100 },
  { field: '', headerName: '', width: 100 },
  { field: '', headerName: '', width: 100 },
  { field: '', headerName: '', width: 100 },






  { field: 'id', headerName: 'ID', width: 70 },
  { field: 'firstName', headerName: 'First name', width: 130 },
  { field: 'lastName', headerName: 'Last name', width: 130 },
  {
    field: 'age',
    headerName: 'Age',
    type: 'number',
    width: 90,
  },
  {
    field: 'fullName',
    headerName: 'Full name',
    description: 'This column has a value getter and is not sortable.',
    sortable: false,
    width: 160,
    valueGetter: (params) =>
      `${params.row.firstName || ''} ${params.row.lastName || ''}`,
  },
];

function App() {
  return (
    <div>
      <div style={{ height: 400, width: '100%' }}>
        <DataGrid
          rows={Votes}
          columns={columns}
          pageSize={5}
          rowsPerPageOptions={[5]}
          checkboxSelection
        />
      </div>
    </div>
  );
}

export default App;
